import {Post} from "./Post/Post";


export const MyPosts = () => {

    let postsData = [
        {id: 1, message: 'Hi, my friend!', likesCount: 11},
        {id: 2, message: 'My first post', likesCount: 12},
    ]
    let postsElement = postsData.map(el => <Post message={el.message} likesCount={el.likesCount} key={el.id}/>)

    return (
        <div className={classes.postsBlock}>
            <h2>MyPosts</h2>
            <div>
                <div>
                    <textarea>a</textarea>
                </div>
                <div>
                    <button>Add Post</button>
                    <button>Remove</button>
                </div>

            </div>
            <div className={classes.post}>
                {postsData.map(el => {
                    return <li key={el.id}>{el.message} {el.likesCount} </li>

                })}
            </div>

        </div>
    )
}
